import React from 'react';
import Link from 'next/link';
import { Menu, Input, Button } from 'antd';

const AppLayout = ({ children }) => {
    return(
        <div>
            <Menu>
                <Item key="home">노드버드</Item>
                <Item key="profile">프로필</Item>
                <Item key="mail">
                    <Search enterButton />
                </Item>
            </Menu>
            {children}
        </div>
    );
};

export default AppLayout;
